const Index = () => (
  <div className="index-container">
    <h1>R E N A</h1>
    <h3>It's Just Art</h3>
    <style jsx>{
      `
      * {
        font-family: Roboto;
        box-sizing: border-box;

      }
     h1, h3 {
       color: #f5f1d0
     }
     h1 {
       font-size: 3rem;
       margin-bottom: 0rem
     }
     h3 {
       margin-top: 0
     }
      .index-container {
        display: flex;
        flex-direction: column;
        align-items: center;
        background-color: #071a24;
      }
      `
    }
    </style>
  </div>
)

export default Index
